// SPDX-License-Identifier: MIT
pragma experimental ABIEncoderV2;
pragma solidity ^0.6.0;

contract VoteSaving {
    struct Member{
        uint id;
        string name;
        bool isVoted;
    }

    mapping (uint => Member) public members;
    event savingEvent(uint indexed _memberId);
    uint public memberCount;


    constructor() public {
        memberCount = 0;
        addMember("Vlad", true);
        addMember("Nastya", false);
    }

    function addMember(string memory _name, bool _isVote) public {
        members[memberCount] = Member(memberCount, _name, _isVote);
        memberCount++;
    }

    function getMember(uint _memberId) public view returns(Member memory){
        return members[_memberId];
    }
}
